import React, { useState } from 'react';
import './App.css';

function RegisterPage() {
  const [username, setUsername] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [phone, setPhone] = useState('');

  return (
    <div className="min-h-screen flex flex-col justify-center items-center bg-gray-100">
      <div className="relative z-10 bg-purple-500 p-8 rounded-lg shadow-md max-w-lg w-full mx-auto mt-10">
        <h1 className="text-3xl font-bold mb-6 text-white">Register Page</h1>
        <div className="mb-6">
          <input
            type="text"
            placeholder="Username"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
            className="w-full p-3 border border-purple-300 rounded bg-purple-50 focus:outline-none focus:border-purple-500"
          />
        </div>
        <div className="mb-6">
          <input
            type="email"
            placeholder="Email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            className="w-full p-3 border border-purple-300 rounded bg-purple-50 focus:outline-none focus:border-purple-500"
          />
        </div>
        <div className="mb-6">
          <input
            type="password"
            placeholder="Password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            className="w-full p-3 border border-purple-300 rounded bg-purple-50 focus:outline-none focus:border-purple-500"
          />
        </div>
        <div className="mb-6">
          <input
            type="text"
            placeholder="Phone"
            value={phone}
            onChange={(e) => setPhone(e.target.value)}
            className="w-full p-3 border border-purple-300 rounded bg-purple-50 focus:outline-none focus:border-purple-500"
          />
        </div>
        <button className="w-full bg-white text-purple-500 p-3 rounded hover:bg-purple-50 focus:outline-none">Register</button>
      </div>
    </div>
  );
}

export default RegisterPage;
